(1, 'user-register', 'User Registration', 'Email confirmation during user registration.', '                                                                                                                        <p><img src=\"data:image/png;base64,\" data-filename=\"popin.png\" style=\"width: 176px;\"><span style=\"background-color: transparent; font-family: \" century=\"\" gothic\";=\"\" font-size:=\"\" 11pt;=\"\" white-space:=\"\" pre-wrap;\"=\"\"><br></span></p><p><span style=\"background-color: transparent; font-family: \" century=\"\" gothic\";=\"\" font-size:=\"\" 11pt;=\"\" white-space:=\"\" pre-wrap;\"=\"\">Hi {name},</span><br></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:\'Century Gothic\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">Welcome to PopIn! Please confirm your email address so you can start setting up your profile. </span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:\'Century Gothic\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">Confirm by clicking {activationLink}</span><span style=\"font-size:11pt;font-family:\'Century Gothic\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">.</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:\'Century Gothic\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">See you soon, {name}</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"background-color: transparent; font-family: \" century=\"\" gothic\";=\"\" font-size:=\"\" 11pt;=\"\" white-space:=\"\" pre-wrap;\"=\"\">The PopIn Crew</span></p><div><span style=\"font-size:11pt;font-family:\'Century Gothic\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\"><br></span></div>                                                                                                            ', 'Active', '1497507256', '1518437930', '103.82.222.24'),
(2, 'forgot-password', 'Forgot Password', 'Forgot password email', '                                        <p>Hello {name},</p>\r\n<p>&nbsp;</p>\r\n<p>You are requested to forgot password. Below are your login details.</p>\r\n<p>&nbsp;</p>\r\n<p>Email : {email}</p>\r\n<p>Password : {password}</p>\r\n<p>&nbsp;</p>\r\n<p>{signature}</p><p><img src=\"http://www.neurons-it.in/Popin/uploads/site/thumb/logo.png\" style=\"width: 67px;\"><br></p>                                    ', 'Active', '1497260918', '1501657168', '122.163.139.80'),
(3, 'social-register', 'Social Register', 'Email sent to the host while he/she is register with Google / Facebook', '                                        <p>Hello {name},</p>\r\n<p>&nbsp;</p>\r\n<p>Thank you for registering using your social account of {social}.</p>\r\n<p>&nbsp;</p>\r\n<p>Your login details are :</p>\r\n<p>Email : {email}</p>\r\n<p>Password : {password}</p>\r\n<p>&nbsp;</p>\r\n<p>{signature}</p>\r\n<p>&nbsp;<img src=\"http://www.neurons-it.in/Popin/uploads/site/thumb/logo.png\" style=\"width: 67px;\"></p>                                    ', 'Active', '1497269356', '1501657126', '122.163.139.80'),
(4, 'email-verification', 'Email Verification ', 'Email Verification', '                                                                                <p><img src=\"data:image/png;base64,\" data-filename=\"popin.png\" style=\"width: 176px;\"><span style=\"background-color: transparent; font-family: &quot;Century Gothic&quot;; font-size: 11pt; white-space: pre-wrap;\"><br></span></p><p><span style=\"background-color: transparent; font-family: &quot;Century Gothic&quot;; font-size: 11pt; white-space: pre-wrap;\">Hi {name},</span><br></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 11pt; font-family: &quot;Century Gothic&quot;; background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\">Welcome to PopIn! Please confirm your email address so you can start setting up your profile. </span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 11pt; font-family: &quot;Century Gothic&quot;; background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\">Confirm by clicking {activationLink}</span><span style=\"font-size: 11pt; font-family: &quot;Century Gothic&quot;; background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\">.</span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 11pt; font-family: &quot;Century Gothic&quot;; background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\">See you soon, {name}</span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"background-color: transparent; font-family: &quot;Century Gothic&quot;; font-size: 11pt; white-space: pre-wrap;\">The PopIn Crew</span></p><div><span style=\"background-color: transparent; font-family: &quot;Century Gothic&quot;; font-size: 11pt; white-space: pre-wrap;\"><br></span></div><p><br></p><div><span style=\"font-size:11pt;font-family:\'Century Gothic\';color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\"><br></span></div>                                                                        ', 'Active', '1497269356', '1509176541', '103.12.135.76'),
(5, 'appointment-confirmation', 'Appointment Confirmation', 'Appointment confirmation .', '<p style=\"padding-top: 10px;\"><span style=\"font-family: Tahoma; background-color: transparent; font-size: 11pt; white-space: pre-wrap;\">Hi </span><span style=\"font-family: Tahoma; background-color: transparent;\">{name}</span><span style=\"font-family: Tahoma; background-color: transparent; font-size: 11pt; white-space: pre-wrap;\">,</span></p><p style=\"padding-top: 10px;\"><span style=\"font-family: Tahoma; background-color: transparent; font-size: 11pt; white-space: pre-wrap;\">Thank you for confirming your appointment with {professionalname} on {date}.<br></span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><font face=\"Tahoma\"><span style=\"font-size: 11pt; background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\">Confirm by clicking </span>&nbsp;{confirmlink}<span style=\"font-size: 11pt; background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\">.</span></font></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 11pt; background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><font face=\"Tahoma\">See you soon,</font></span></p><p><span style=\"background-color: transparent; font-family: Tahoma; font-size: 11pt; white-space: pre-wrap;\">The PopIn Crew</span></p><p><span style=\"background-color: transparent; font-family: Tahoma; font-size: 11pt; white-space: pre-wrap;\"><br></span><img src=\"http://www.neurons-it.in/Popin/uploads/site/thumb/logo.png\" style=\"width: 67px;\"></p>', 'Active', '1509169519', '1509169519', '103.12.135.76'),
(6, 'cancel-rental', 'Rental Cancellation', 'Rental Cancellation', '                                        <p style=\"padding-top: 10px;\"><span style=\"font-family: Tahoma; background-color: transparent; font-size: 11pt; white-space: pre-wrap;\">Hi </span><span style=\"font-family: Tahoma; background-color: transparent;\">{name}</span><span style=\"font-family: Tahoma; background-color: transparent; font-size: 11pt; white-space: pre-wrap;\">,</span></p><p style=\"padding-top: 10px;\"><span style=\"background-color: transparent;\"><font face=\"Tahoma\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\">Space rental has been cancelled.Below are the rental details:</span></font></span></p><p style=\"padding-top: 10px;\"><span style=\"background-color: transparent;\"><font face=\"Tahoma\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\">Space : {title}</span></font></span></p><p style=\"padding-top: 10px;\"><span style=\"background-color: transparent;\"><font face=\"Tahoma\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\">PopIn: {popin}</span></font></span></p><p style=\"padding-top: 10px;\"><span style=\"background-color: transparent;\"><font face=\"Tahoma\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\">PopOut : {popout}</span></font></span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 11pt; background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><font face=\"Tahoma\">See you soon,</font></span></p><p><span style=\"background-color: transparent; font-family: Tahoma; font-size: 11pt; white-space: pre-wrap;\">The PopIn Crew</span></p><p><span style=\"background-color: transparent; font-family: Tahoma; font-size: 11pt; white-space: pre-wrap;\"><br></span><img src=\"http://www.neurons-it.in/Popin/uploads/site/thumb/logo.png\" style=\"width: 67px;\"></p>                                    ', 'Active', '1509169519', '1509173217', '103.