(7, 'cancel-appointment', 'Appointment Cancellation', 'Appointment Cancellation', '                                        <p style=\"padding-top: 10px;\"><span style=\"font-family: Tahoma; background-color: transparent; font-size: 11pt; white-space: pre-wrap;\">Hi </span><span style=\"font-family: Tahoma; background-color: transparent;\">{name}</span><span style=\"font-family: Tahoma; background-color: transparent; font-size: 11pt; white-space: pre-wrap;\">,</span></p><p style=\"padding-top: 10px;\"><span style=\"background-color: transparent;\"><font face=\"Tahoma\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\">Space rental has been cancelled.Below are the rental details:</span></font></span></p><p style=\"padding-top: 10px;\"><span style=\"background-color: transparent;\"><font face=\"Tahoma\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\">Space : {title}</span></font></span></p><p style=\"padding-top: 10px;\"><span style=\"background-color: transparent;\"><font face=\"Tahoma\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\">PopIn: {popin}</span></font></span></p><p style=\"padding-top: 10px;\"><span style=\"background-color: transparent;\"><font face=\"Tahoma\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\">PopOut : {popout}</span></font></span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 11pt; background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><font face=\"Tahoma\">See you soon,</font></span></p><p><span style=\"background-color: transparent; font-family: Tahoma; font-size: 11pt; white-space: pre-wrap;\">The PopIn Crew</span></p><p><span style=\"background-color: transparent; font-family: Tahoma; font-size: 11pt; white-space: pre-wrap;\"><br></span><img src=\"http://www.neurons-it.in/Popin/uploads/site/thumb/logo.png\" style=\"width: 67px;\"></p>                                    ', 'Active', '1509169519', '150